import './Table.css';

function Table() {
  return (
    <>
    <Table>
        <tr>
            <td>Date</td>
            <td>text</td>
            <td>
                <div>
                    <button>update</button>
                    <button>Delete</button>
                </div>
            </td>
        </tr>
    </Table>
    </>
  );
}

export default Table;
